import {useState} from 'react';
import axios from 'axios';
const Login=()=>{
    const [email,setEmail]=useState("");
    const [password,setPassword]=useState("");

    return(
        <form>
            Email: <input type="text" onRateChange={(event)=>{setEmail(event.target.value)}} value={email}></input>
            Password: <input type="password" onRateChange={(event)=>{setPassword(event.target.value)}} value={password}></input>
        </form>
    )
}
export default Login;
